#include <iostream>
#include <vector>
#include <algorithm>
#include <bitset>
#include <unordered_set>

using namespace std;

void printVec(std::vector<int>& v){
    for(auto it = v.begin(); it != v.end(); ++it){
        cout << *it << " ";
    }
}

class Solution {
public:
    vector<int> diStringMatch(string S) {
        std::vector<int> output;

        int currNum = 0;
        output.push_back(currNum);

        int minNum = currNum;
        int maxNum = currNum;
        
        for(char currChar:S){
            if(currChar == 'I'){
                currNum = maxNum + 1;
                maxNum = currNum;
            }
            else if(currChar == 'D'){
                currNum = minNum - 1;
                minNum = currNum;
            }

            output.push_back(currNum);
        }

        //Add abs(minNum) to whole array if it's negative
        if(minNum < 0){
            for(unsigned i = 0; i < output.size(); ++i){
                output[i] += (-minNum);
            }
        }

        return output;
    }
};

int main(){
    Solution s;
    vector<int> diString= s.diStringMatch("");
    cout << "DI Vector:" << endl;
    printVec(diString);
    std::cout << std::endl;
}
